import React from "react";
import { goToAuth } from "../navigation_utils";

const Dashboard = () => {
    return <div>
        <h1>
            This is the Dashboard
        </h1>
        <h2>
            <button onClick={goToAuth}>
                Click here to Login
            </button>
        </h2>
    </div>
}

export default Dashboard;
